import Link from 'next/link';

const Navbar = () => {
  const styles = {
    display: 'flex',
    background: 'grey',
    justifyContent: 'space-between',
    padding: '1rem'
  };

  return (
    <div style={styles}>
      <Link href='/about'>
        <a>About Page</a>
      </Link>
      <Link href='/'>
        <a>Home</a>
      </Link>
    </div>
  )
}

export default Navbar
